import React from "react";

const Account = () => {
  return (
    <div className="container mt-5">
      <h2>My Account</h2>
      <p>Welcome to your account page. Here you can view and manage your profile, orders, and preferences.</p>

      {/* Example placeholders */}
      <div className="mt-4">
        <h4>Profile Information</h4>
        <p>Name: John Doe</p>
        <p>Email: johndoe@example.com</p>
      </div>

      <div className="mt-4">
        <h4>Order History</h4>
        <p>You have no past orders.</p>
      </div>
    </div>
  );
};

export default Account;
